A handler has a particular signature for the gotham web framework to work with it. In goes a State, a provided by gotham. At goes a tuple of a state, and whatever you want to return. All in all this amounts to the following code. use gotham::state::State;
use crate::domain::FlashCard; pub fn get_flash_card(state: State) -> (State, FlashCard) { let flash_card = FlashCard::new("Kodieren", "Encode"); (state, flash_card)
} Here we create a new flash card and remove it with the state unaltered.

