The web is build about requests and responses. Each response can be of a certain MIME type, but it can't know everything that could be send back. So we will need to tell gotham how to create a real response from a flash card. There is a trait that you can implement that does precisely that. It is called IntoResponse and it will allow us to specifiy how to turn a flash card into a response. In order to use it we need to declare it, and related type. use gotham::handler::IntoResponse;
use gotham::helpers::http::response::create_response;
use gotham::state::State;
use hyper::{Body, Response, StatusCode}; Next we should implement the IntoResponse trait. impl IntoResponse for FlashCard { fn into_response(self, state: &State) -> Response<Body> { create_response( state, StatusCode::OK, mime::APPLICATION_JSON, serde_json::to_string(&self).expect("serialized flash card"), ) }
} Here we use the create_response function to create a valid response, which contains JSON with a body of a string representation of the flash card.

