Next we will create a minimal server that responds with Hello, world! with every request. Change main.rs with extern crate gotham; use gotham::state::State; const HELLO_WORLD: &'static str = "Hello World!"; pub fn say_hello(state: State) -> (State, &'static str) { (state, HELLO_WORLD)
} pub fn main() { let addr = "localhost:8886"; println!("Listening for requests at http://{}", addr); gotham::start(addr, || Ok(say_hello))
} This is taken from the hello-world example from the Gotham page.

