In order to leverage the serialization capabilities of serde_json we need to create a serde serializer. There is a very cool trick that serde knows that makes this a breeze. The first thing we need to do is to announce we our needing serde. use serde::Serialize; The other thing is that we need to tell serde that we would like it to derive serializers for our data types. We can do this by annotating both FlashCard and Face with a derive annotation. E.g. Face would be annotated like #[derive(Serialize)]
pub enum Face { Front, Back,
}

