With the automatic part of serde done, it is good to see if serialization works like we expect. The best way to do this is to test is. Rust integrates testing right at the place where the source is created. Add the following code at the end of src/domain/mod.rs. #[cfg(test)]
mod test { use super::*; use serde_json; #[test] fn flash_card_can_be_serialized_to_json() { let flash_card = FlashCard::new("Wettervorhersage", "Weather forecast"); let actual = serde_json::to_string(&flash_card).unwrap(); let expected = r#"{"front":"Wettervorhersage","back":"Weather forecast","face":"Front"}"#.to_owned(); assert_eq!(actual, expected); }
} There is some boilerplate to let the test framework know about what we want to test. The actual test is let flash_card = FlashCard::new("Wettervorhersage", "Weather forecast"); let actual = serde_json::to_string(&flash_card).unwrap(); let expected = r#"{"front":"Wettervorhersage","back":"Weather forecast","face":"Front"}"#.to_owned(); assert_eq!(actual, expected); It creates a FlashCard, serializes it to JSON with serde_json, sets up an expectation, and checks it the expectation is met. If you run cargo test it should give the all green.
